import React from 'react';
import styled from 'styled-components';
import ListItem from './ListItem';

const ListBox = styled.div`
    width:212px;
    height:70px;
    border: 1px solid black;
`;

const List = () => {
    return (
        <ListBox>
            <ListItem src={require("https://img.hankyung.com/photo/201908/15671267831567126783_pabw.jpg")} />
            <ListItem src={require("https://img.hankyung.com/photo/201908/15671267831567126783_pabw.jpg")} />
            <ListItem src={require("https://img.hankyung.com/photo/201908/15671267831567126783_pabw.jpg")} />        
        </ListBox>
    );
};

export default List;
